/**
 * @param {string} s
 * @return {number}
 */
var lengthOfLongestSubstring = function (s) {
	function uniqueCharacters(str) {
		var letters = new Array(97);
		var index;

		for (var i = 0; i < letters.length; i++) letters[i] = 0;

		for (var i = 0; i < str.length; i++) {
			index = str.charCodeAt(i) - 31;
			letters[index] += 1;

			if (letters[index] > 1) return false;
		}

		return true;
	}

	if (s.length <= 1) {
		return s.length;
	}

	var mLeft = 0,
		mRight = mLeft + 1,
		cLeft = 0,
		cRight = cLeft + 1,
		substr;

	for (var i = 1; i < s.length; i++) {
		cRight = i + 1;
		substr = s.substring(cLeft, cRight);

		if (uniqueCharacters(substr)) {
			if (substr.length > mRight - mLeft) {
				mLeft = cLeft;
				mRight = cRight;
			}
		} else {
			cLeft++;
		}
	}

	return mRight - mLeft;
};

